import React from 'react'
import GridLayout from 'react-grid-layout';

export default class Grid extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div>
        <GridLayout className="layout" layout={this.props.layout} cols={12} rowHeight={30} width={1200}>
          {
            this.props.layout.map(elem => {
              if (elem.i.includes("SP-")) {
                return <div className={(elem.i === this.props.selected)?"grid-selected":"react-grid-space"} key={elem.i}></div>
              } else {
                return <div className={(elem.i === this.props.selected)?"grid-selected":""} key={elem.i}>{elem.i}</div>
              }
            })
          }
        </GridLayout>
      </div>
    )
  }
}
